import React from "react";
import "../footer/footer.css";

function footer() {
  return (
    <div>
      {/*INFORMATION SECTION*/}
      <div className="information_section">
        <div className="service_section">
          <div className="service_button">
            <button></button>
          </div>
          <div className="service_information"></div>
        </div>
        <div className="support_section">
          <div className="support_button"></div>
          <div className="support_information"></div>
        </div>
        <div className="myaccount_section">
          <div className="myaccount_button"></div>
          <div className="myaccount_information"></div>
        </div>
      </div>

      {/*CONTACT SECTION*/}
      <div className="contact_section"></div>
    </div>
  );
}

export default footer;
